def knight_min_health(dungeon):
    dp = [[0] * len(dungeon[0]) for _ in range(len(dungeon))]
    dp[0][0] = dungeon[0][0]
    for i in range(1, len(dungeon)):
        dp[i][0] = max(dp[i-1][0] - dungeon[i][0], dp[i][0] - dungeon[i][0])
    for j in range(1, len(dungeon[0])):
        dp[0][j] = max(dp[0][j-1] - dungeon[0][j], dp[0][j] - dungeon[0][j])
    for i in range(1, len(dungeon)):
        for j in range(1, len(dungeon[0])):
            dp[i][j] = max(dp[i-1][j] - dungeon[i][j], dp[i][j-1] - dungeon[i][j],
                dp[i-1][j-1] - dungeon[i][j-1])
    return dp[-1][-1]

