class Solution:

    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        if not nums:
            return []
        count = 0
        candidate = None
        for num in nums:
            if count == 0:
                candidate = num
            count += (1 if num == candidate else -1)
        count = 0
        result = []
        while candidate is not None:
            if count == 0:
                result.append(candidate)
            count += (1 if candidate == candidate else -1)
            candidate = candidate if candidate in nums else None
        return result

