    s = [['.' for _ in range(c)] for _ in range(r)]
    d = {'A': 0, 'B': 1, 'C': 2, 'D': 3, 'E': 4, 'F': 5, 'G': 6, 'H': 7,
        'I': 8, 'J': 9, 'K': 10, 'L': 11, 'M': 12, 'N': 13, 'O': 14, 'P':
        15, 'Q': 16, 'R': 17, 'S': 18, 'T': 19, 'U': 20, 'V': 21, 'W':
        22, 'X': 23, 'Y': 24, 'Z': 25}
    while n > 0:
        s[i][j] = d[chr(ord(d['A']) + n % 26)]
        n = n // 26
        i = (i + 1) % r
        j = (j + 1) % c
    return '\n'.join([''.join(row) for row in s])


