    return None


def build_grid(r, c, i, j, r, c):
    grid = [['.' for _ in range(c)] for _ in range(r)]
    x, y, r, c = i, j, r, c
    while r > 0:
        grid[x][y] = 'x'
        r -= 1
        x -= 1
        if x < 0:
            x = 0
            y -= 1
            if y < 0:
                return None
    while c > 0:
        grid[x][y] = 'x'
        c -= 1
        y -= 1
        if y < 0:
            return None
    return grid


