def solve(word_dict, start, end):
    if start in word_dict and end in word_dict:
        return word_dict[start], word_dict[end]
    if start == end:
        return 0, -1
    min_steps = float('inf')
    word = ''
    for i in range(26):
        for j in range(26):
            if i == j:
                continue
            new_start = start[0:i] + chr(ord(start[i]) + 1) + start[i + 1:]
            new_end = end[0:j] + chr(ord(end[j]) - 1) + end[j + 1:]
            steps, new_start, new_end = solve(word_dict, new_start, new_end)
            if steps < min_steps:
                min_steps = steps
                word = chr(ord(start[i]) + 1) + word
    return word, min_steps


